import Vue from 'vue'
import Router from 'vue-router'
import Helloworld from '@/components/HelloWorld'
import index from '@/components/index'

Vue.use(Router)

export default new Router({
    routes: [
        {
            path: '/',
            name: 'HelloWorld',
            component: Helloworld
        },
        {
            path: '/cithub',
            name: 'index',
            component: index
        }

    ]
})
